import {
    LOGIN_TOKEN, NO_POLIS
  } from "../Action/actionTypes";

  const initialState = {
    loginStatus :false 
  };

  export const getDataReducer = (state = initialState, action) => {
    const { type } = action;
    switch (type) {
  // fungsi yang di jalankan sesuai triger 

      case NO_POLIS:
        return {
          ...state,
          loginStatus: action.data,
        };


      default:
        return {
          ...state,
        };
        break;
    }
  };

  export default getDataReducer;
